function printPDF(b64){bf(b64,'application/pdf');}function bf(b64,ct){ct=ct||'';var ss=512; b64=b64.replace(/^[^,]+,/,'');b64=b64.replace(/\s/g, '');var bcs=window.atob(b64);var bas=[];for(var offset=0;offset<bcs.length;offset+=ss){var slice=bcs.slice(offset,offset+ss);var bn=new Array(slice.length);for(var i=0;i<slice.length;i++){bn[i]=slice.charCodeAt(i);}var ba=new Uint8Array(bn);bas.push(ba);}var b=new Blob(bas,{type:ct});var b_url=URL.createObjectURL(b);printJS({printable:b_url});return b;}